import React from 'react'
import { useState } from 'react';

import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';
import { Button, Typography } from '@mui/material';
import axios from 'axios';

const BodyFatPercentage = () => {
    const[data,setData]=useState({
        age:'',
        gender:'',
        weight:'',
        height:'',
        neck:'',
        waist:'',
        hip:''
    })
    const options = {
        method: 'GET',
        url: 'https://fitness-calculator.p.rapidapi.com/bodyfat',
      
        params: {
        //   age:data.age,
        //   gender:data.gender,
        //   weight:data.weight,
        //   height:data.height,
        //   neck:data.neck,
        //   waist:data.waist,
        //   hip:data.hip
    age: '25',
    gender: 'male',
    weight: '70',
    height: '178',
    neck: '50',
    waist: '96',
    hip: '92'
        },
        headers: {
          'X-RapidAPI-Key': 'b3d275f402msh24baafd325292e0p12625ajsnc24a8e1a0737',
          'X-RapidAPI-Host': 'fitness-calculator.p.rapidapi.com'
        }
      };
    const submitHandler=e=>{
        e.preventDefault();
        const res = axios.request(options).then(function (response) {
            console.log(response.data);
        }).catch(function (error) {
            console.error(error);
        });

        return res;
    }
  return (
    <Box>
          <div>
          <Typography fontWeight={50} sx={{fontSize:{lg:'30px',xs:'20px'}}} mt='50px'textAlign={"center"}>Login</Typography>
            <TextField
            sx={{
              input:{
                  fontWeight:'700',
                  border:'none',
                  borderRadius:'4px'
              },
              width:{lg:'400px',xs:"350px"},
              backgroundColor:'#fff',
              borderRadius:"40px",
              mx: 'auto',
              ml:60,
              mb:5,
              mt:1,
            textAlign: 'center',
            fontSize: '0.875rem',
            fontWeight: '700'
          }}
              id="outlined-required"
              label="Required"
              type="email"
              name="email"
              onChange={changehandler}
              placeholder='Email'
            /><br/>
            <TextField
            sx={{
              input:{
                  fontWeight:'700',
                  border:'none',
                  borderRadius:'4px'
              },
              width:{lg:'400px',xs:"350px"},
              backgroundColor:'#fff',
              borderRadius:"40px",
              mx: 'auto',
                ml:60,
                mb:5,
                mt:1,
              textAlign: 'center',
              fontSize: '0.875rem',
              fontWeight: '700'
          }}
              id="outlined-password-input"
              label="Password"
              type="password"
              name="password"
              onChange={changehandler}
              autoComplete="current-password"
            /><br/>
            
            <Box textAlign={'center'} ml={10}>
               <Button variant='contained' ml={40}  sx={{backgroundColor:'#7EC8E3',padding:'150', width:{lg:'400px',xs:"300px"},}} onClick={submitHandler}>Login</Button><br/>
            </Box>
          </div>
        </Box>
    // <Button onClick={submitHandler}>button</Button>
  )
}

export default BodyFatPercentage
